import logo from '../images/One-Piece-Logo 1.svg'

export default class SinopsisContainerReadMoreLogo extends Component{
    render(){
        return(<div id="logoReadMore" className="hideDesktop hideMore">
                    <img src={logo} alt="" />
                </div>)
    }
}
